// Main.jsx
import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Login from './src/components/Login';
import Home from './src/components/Home';
import asesoriasDisponibles from './asesoriasDisponibles';

const Stack = createStackNavigator();

const Main = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(false); // Puedes usar un estado para gestionar el inicio de sesi√≥n

    return (
        <NavigationContainer>
            <Stack.Navigator initialRouteName={isLoggedIn ? 'Home' : 'Login'}>
                <Stack.Screen name="Login" component={Login} />
                <Stack.Screen name="Home" component={Home} />
                <Stack.Screen name="asesoriasDisponibles" component={asesoriasDisponibles} />
            </Stack.Navigator>
        </NavigationContainer>
    );
};

export default Main;
